window.bookSummaryJSON = "<p><b><i>A forbidden attraction drives an all-consuming hunger, but breaking the rules comes at a dangerous price.</i></b> </p> <p>Travis - the formerly human, former sheriff turned immortal incubus - wants nothing more than to hide from his past. Well, that and seduce every willing female he can find. After months of going incognito in the mortal world, he stumbles onto a strange woman whose beauty captivates him even while her haughty attitude drives him insane. </p> <p>The bad news? She's being hunted by a trio of gods and an army of elemental bounty hunters, all determined to capture her for reasons she claims not to know. Stuck with protecting her, Travis may realize she's his fated mate - or drag them both down into oblivion. </p> <p><b><i>Unbidden Hunger</i></b><b> is the fifth book in the award-winning Undercover Elementals series of steamy paranormal romances.</b></p>"; 
